import React from "react";
import "../Style_Pages/New_Users_Queue.css";
import Header from "../Components/Header";
import Footer from "../Components/Footer";
import { getAuthUser } from "../helper/storage";

export const History = () => {
  const auth = getAuthUser();
  const [history, setMovies] = useState({
    loading: true,
    results: [],
    err: null,
    reload: 0,
  });

  useEffect(() => {
    setMovies({ ...movies, loading: true });
    axios
      .get("http://localhost:4000/movies")
      .then((resp) => {
        setMovies({ ...movies, results: resp.data, loading: false, err: null });
      })
      .catch((err) => {
        setMovies({
          ...movies,
          loading: false,
          err: " something went wrong, please try again later ! ",
        });
      });
  }, [movies.reload]);
  return (
    <>
      <Header />

      <div className="table_container">
        <table>
          <thead>
            <tr>
              <th>Exam Id</th>
              <th>Degree</th>
              <th>Email</th>
              <th>Date</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>90%</td>
              <td>Mohamed.Ali@example.com</td>
              <td>15 Apr,2023</td>
            </tr>
            <tr>
              <td>1</td>
              <td>90%</td>
              <td>Mohamed.Ali@example.com</td>
              <td>15 Apr,2023</td>
            </tr>
            <tr>
              <td>1</td>
              <td>90%</td>
              <td>Mohamed.Ali@example.com</td>
              <td>15 Apr,2023</td>
            </tr>
          </tbody>
        </table>
      </div>

      <Footer />
    </>
  );
};
